import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';
import { useEffect } from 'react';

export function GetEvent (data, instance, accounts){

  const request = {
      ...loginRequest,
      account: accounts[0]
  };  

  const tokenProm = instance.acquireTokenSilent(request);

  console.log(data)

  var ur = data.map((user) => {
    if(user.accountEnabled === true && user.userPrincipalName.length < 13 && user.userPrincipalName.length > 10){
      return user
    }
  })

  ur = ur.filter((elem) => {return elem !== undefined})
  return ur.splice('')
}
